def solve(r, g, b):
    r = r/255
    g = g/255
    b = b/255
    cmax = max(r, g, b)
    cmin = min(r, g, b)
    delta = cmax - cmin

    if delta == 0:
        h = 0
    elif cmax == r:
        h = 60 * ((g-b)/delta % 6)
    elif cmax == g:
        h = 60 * ((b-r)/delta + 2)
    else:
        h = 60 * ((r-g)/delta + 4)

    if cmax == 0:
        s = 0
    else:
        s = delta/cmax

    v = cmax

    return h, s, v

